import React, {Component} from 'react';
import "./Counter.css"
class Counter extends Component{
  render(){
    return (
      <div className="Counter">
        <h1>Counter</h1>
        <button onClick={increment}>+1</button>
        <span></span>
      </div>
    );
  }
}

function increment(){
    console.log("yaya")
}

export default Counter;
